cap = cv2.VideoCapture(video_paths[3])

while cap.isOpened():
    ret, img = cap.read()
    img = cv2.cvtColor(img, cv2.COLOR_BGR2GRAY)
    #cv2.equalizeHist(img_hist, img_hist)
    img_masked = opening_masking(img)
    img_masked = segnet_masking(img)
    cv2.imshow('', img_masked)
    key = cv2.waitKey()
    if key == ord('q'):
        cv2.destroyAllWindows()
        exit()
    elif key == ord('s'):
        cv2.imwrite('thesis/original.png', img)
        cv2.imwrite('thesis/masked.png', img_masked)
